import React from 'react';
import { ThemeProvider, createTheme } from '@mui/material';
import LiquidInterface from './components/LiquidInterface';

const theme = createTheme({
  palette: {
    primary: {
      main: '#1976d2',
    },
    secondary: {
      main: '#dc004e',
    },
  },
});

function App() {
  return (
    <ThemeProvider theme={theme}>
      <LiquidInterface />
    </ThemeProvider>
  );
}

export default App;
